import pic from "../assets/img/haland.jpeg";
export class PlayerCompare extends Component {
  render() {
    return (
      <div>
        <Row>
        <Col>
                          <Card style = {{height:350,width:350,borderColor:"#fb6340",marginTop:50,marginLeft:40,borderRadius:20}} >
                      <CardImg top width="100%" src={pic} alt="Card image cap" />
                      <CardBody>
                          <CardTitle tag="h2" style={{textAlign:"center"}}>
                                Erling Haland
                          </CardTitle>
                      </CardBody>
                            </Card>
        </Col>
       <Col>
       </Col>



        <Col>
        <Card style = {{height:350,width:350,borderColor:"#fb6340",marginTop:50,marginRight:140,borderRadius:20}} >
                      <CardImg top width="100%" src={pic} alt="Card image cap" />
                      <CardBody>
                          <CardTitle tag="h2" style={{textAlign:"center"}}>
                                Erling Haland
                          </CardTitle>
                      </CardBody>
                            </Card>
        </Col>
        </Row>
      </div>
    );
  }
}

export default PlayerCompare;
